using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

using SAPTeam.Kryptor.CryptoProviders;

namespace SAPTeam.Kryptor.Tests
{
    public class DataIntegrityTests
    {
        const string SampleData = "dGVzdAo=";
        const string SharedKeyStore = "";

        byte[] data = Convert.FromBase64String(SampleData);
        byte[] keyStoreData = Convert.FromBase64String(SharedKeyStore);
        KeyStore ks;

        public DataIntegrityTests()
        {
            ks = new KeyStore(keyStoreData);
        }

        [Fact]
        public void SKWithDBPTest()
        {
            CryptoProvider cp = new StandaloneKey(ks, dynamicBlockProccessing: true);
            Kes kes = new Kes(cp);

            MemoryStream ms = new MemoryStream(data);
            MemoryStream ms2 = new MemoryStream();

            kes.EncryptAsync(ms, ms2).Wait();

            MemoryStream ms3 = new MemoryStream();

            kes.DecryptAsync(ms2, ms3).Wait();
            Assert.Equal(ms.ToArray(), ms3.ToArray());
        }

        [Fact]
        public void TKWithDBPTest()
        {
